		class: 'm-safety-metrics-panel',
	},
	changeDetection: ChangeDetectionStrategy.OnPush,
	encapsulation: ViewEncapsulation.None,
})
export class SafetyMetricsPanelComponent {
	protected readonly _translationService = inject(TranslateService);

	public readonly safetyMetrics$ = input<SafetyMetricsDto>();

	protected readonly _pieMetrics$: Signal<({datasets: {data: any[]}[], labels: string[]} | undefined)>;
	protected readonly _safetyMetricsDisplay$ = computed(() => {
		const metrics = this.safetyMetrics$();
		if (!metrics) {
			return;
		}

		return drop(safetyMetricsDisplayArray(metrics), 5).filter(res => res.data != 0);
	});
	protected readonly _pieMetricsIncidentTypesOptions = {
		responsive: true,
		plugins: {
			legend: {
			},
			title: {
				display: true,
				text: 'Chart Title',
				padding: {
					top: 20,
					bottom: 40
				}
			}
		}
	}

	constructor() {
		this._pieMetrics$ = computed(() => {
			const displayMetrics = this._safetyMetricsDisplay$();
			if (!displayMetrics) {
				console.log('No metrics');
				return;
			}

			const labels =  displayMetrics.map(({ label }) => label);

			const translatedLabels = this._translationService.instant(labels);
			console.log(translatedLabels)
			return {
				datasets: [{ data: displayMetrics.map((value) => value.data) }],
				labels: values(translatedLabels),
			}
		});
	}

	protected readonly _templatePages$ = computed(() => {
		const metrics = this.safetyMetrics$();
		const displayedMetrics = this._safetyMetricsDisplay$();
		if (!metrics || !displayedMetrics || displayedMetrics.length < 1) {
			return times(1);
		}

		return times(2);
	});
}

